    "description": "Handsome and well proportioned period house in a prime position for Oxford City CentreSituationThe property is located just a mile from the city centre on the desirable Woodstock Road, within the Victorian Suburb Conservation Area. Summertown is to the north and provides a choice of shops, wine bars and restaurants. To the south is Jericho with the Phoenix Picture House, a selection of cafes, bars and restaurants such as Raymond Blanc's Brasserie Blanc. Located a few streets away from the property is Trap Grounds, a nature reserve on the Oxford Canal. Adjacent to this is Port Meadow, and unspoilt ancient meadow on the banks of the River Thames with walks and wildlife. There are excellent schools close by including The Dragon School, Oxford High School, St Edwards School, The Cherwell School and St Philip and St James Primary School. From Oxford Station there are mainline train services to London Paddington or Marylebone (journey about one hour).DescriptionBuilt over three floors, the semi-detached house offers a host of Victorian features including high ceilings, well- proportioned rooms and many large sash windows making the accommodation spacious and light. The accommodation is flexible with three good reception rooms and a garden room on the ground floor and ten bedrooms over the two floors above.AccommodationThe front door opens to a spacious hallway with attractive original Victorian tiled floor. Doors to either side take you to two good size reception rooms to the front of the property. Adjacent is a sitting room with garden room off. The kitchen/breakfast room was updated recently with wooden units and granite work surfaces around a central island. There is a larder and utility room located off the kitchen/breakfast room. Also accessed from the hallway is the cloakroom. An original dog leg staircase rises to the first floor with sash windows to the side. On the first floor there are 5 bedrooms, a bathroom and separate shower room. A door to the front of the house takes you to a balcony. A staircase rises to the second floor with an additional 5 bedrooms, bathroom and separate cloakroom. There is a hatch giving access to the attic.Grounds and gardensTo the front of the house a gravelled driveway behind a low pillared wall provides off-road parking for numerous vehicles. There is side access to the rear garden which is mainly laid to lawn with a patio area off the garden room and an additional sunken sitting area. A path runs along the side of the garden to a timber outbuilding at the bottom of the garden with several rooms/stores and a covered bicycle storage area.",
