    "description": "Nestled in a private corner of exclusive Hid’s Copse Road on the outskirts of Oxford, Water Combe is a brand new property constructed to an extraordinarily high standard with an astonishing attention to detail. The property is full of light and space with most rooms having a double aspect and large windows designed to take advantage of the far reaching and garden views. Bespoke features include a luxurious designer kitchen/breakfast room, generous reception rooms, spacious hallways and landings, an internal green oak frame which adds stunning character, wide oak floors, large bedrooms and fabulous bathrooms with Bateau bath tubs.Set within 1.2 acres, the landscaping has been designed around the Fairy Glen at the bottom of the garden and the Fairy theme continues throughout the house and garden. This enchanting home has had no expense spared to create a unique home for the discerning buyer. EPC Rating B.Local informationCumnor Hill is a sought after residential area just 1.5 miles from the centre of Oxford. It is well served by communications with access to the A34 and Oxford ring road, connecting to the M4 and M40 motorways, with the regional centres of Newbury and Swindon also within easy reach.Communications by rail are also excellent with fast trains from either Oxford or Didcot to London Paddington taking about 50 and 45 minutes respectively. From the coach station at Gloucester Green there are regular services to London Heathrow and Gatwick airports.Hid’s Copse Road is an attractive private no-through road known for its wooded rural setting with detached houses in large gardens. Cumnor Hill has bus pick-ups to all the major independent schools in Central North Oxford as well as Abingdon, Cothill and Cokethorpe.AccommodationSolid oak front door with cast bronze oak leaf handlesMagnificent double height reception hall with oak floor and views through to the marble terrace and garden. Sitting room with vaulted ceiling and exposed brick wall, wood burning stove, double oak framed doors leading to terrace. Kitchen/breakfast room fitted with superb range of bespoke Griggs & Mackay handmade painted and oak lined wall and floor cabinets, Brazilian leathered granite work surfaces, central island breakfast bar with pop up extractor, Gaggenau gas ovens and hob, American style Fisher & Paykel fridge/freezer, double doors to terrace. Dining room and family room, oak floor, suspended wood burning stove, bi-fold doors to terrace. Study with double doors to garden. Ground floor cloakroom and wet room. Gymnasium/bedroom 6 with double doors to garden. Laundry with plumbing for washing machine, tumble dryer. Plant room. From the reception hall a hand carved oak staircase turns and rises gracefully to the first floor with a large window overlooking the garden. From the reception hall a hand carved oak staircase turns and rises gracefully to the first floor with a large window overlooking the garden.Fairy bridge with extraordinary balustrade created by a master blacksmith of entwined vines and flowers, magically crosses the hall below to the master bedroom. Solid oak doors with a safe lock swing open to give access to the grand master bedroom which has a vaulted ceiling and exposed green oak timbers, low windows providing wonderful garden views from the comfort of the bed, dressing area leading to the En-suite bathroom. This sublime space has a marble floor, nickle Bateau bath tub, double shower with rainwater head, two sets of glass doors leading to a balcony with glass balustrade and far reaching Westerly views. Four further bedrooms, three with luxurious designer en-suite bath or shower rooms. Large attic space with natural light, ideal as a playroom or additional bedrooms, if required.Gardens and groundsSliding timber gates give access to the large gravel parking area and round to the double garage. An external staircase leads to a useful home office or workshop with power and light. The delightful gardens are full of mature plants and a colourful selection of Rhododendrons and Azaleas and there is a large area of lawn.The large marble terrace is beautifully laid and is ideal for entertaining. There is an outdoor kitchen with hot and cold running water and stone sink and a built-in barbecue and pizza oven. Intricate pathways lead amongst bushes and tumbling climbing plants and wind down towards Oak and Yew trees that have been designated as Ancient Woodland.There is a mysterious throne and 8 stone seats around a circle cut into the bank, a fine place for midnight excursions. ‘The Fairies Wish’, a beautiful wire sculpture 25ft atop a stricken Oak tree, has been commissioned from Derek Kingzett a renowned contemporary Artist and Wire Sculptor. Five spring fed ponds lead down to the Fairy glen at the bottom of the garden, who knows what else is there…specificationUnderfloor heating throughout the ground floor, designer radiators to first and second floorWide engineered stained oak floors to reception hall, sitting room and dining/family roomPillowed limestone floors to kitchen/breakfast room, cloakroom/wet roomGriggs & Mackay hand built kitchen with oak lined cupboardsGaggenau ovens, microwave, gas hob and dishwasher, pop up extractor fanFisher & Paykel fridge and freezerBrazilian leathered granite worksurfaces and breakfast barExposed green oak internal timber framePlant room with data cabinet, dual Cat 5 connectivity, satellite and TV to every habitable room, Smart phone controlled heating and hot waterDual perpetual hot water throughout the house for instant hot waterAll mains services connected, gas fired central heating.Local authority and servicesAll mains connected. Vale of White Horse District Council.ConveyancingThrough our in house Conveyancing team, we can ensure ease and efficiency for a competitive, no-sale, no-fee quote. Ask us for a quote today.DisclaimerThese particulars are a general guide only. They do not form part of any contract. Services, systems and appliances have not been tested.Buyers informationIn accordance with hmrc Anti Money Laundering Regulations a buyer(s) must attend our office to provide Photo Identification and Proof of Address (valid in last 3 months) once a sale is agreed.",
